import json
from mpl_toolkits.basemap import Basemap
import matplotlib.pyplot as plt

def draw_path_on_map(path):
    # Извлечение координат точек из JSON
    lon = [point["lon"] for point in path]
    lat = [point["lat"] for point in path]

    # Создание карты
    m = Basemap(projection="merc", llcrnrlon=min(lon), llcrnrlat=min(lat),
                urcrnrlon=max(lon), urcrnrlat=max(lat), lat_ts=0, resolution='l')

    # Преобразование координат в координаты карты
    x, y = m(lon, lat)

    # Рисование пути на карте
    m.plot(x, y, 'b-', markersize=5)

    # Настройка отображения карты
    m.drawcoastlines()
    m.drawcountries()
    m.fillcontinents(color='coral', lake_color='aqua')

    # Отображение карты
    plt.title("Path on Map")
    plt.show()

